/** @format */

import React from "react";

import { useSelector } from "react-redux";
import { selectIsSignIn } from "../../slices/authenticate.slice";
import SignIn from "../sign-in/sign-in.component";
import SignUp from "../sign-up/sign-up.component";

const Authenticate = () => {
  const isSignIn = useSelector(selectIsSignIn);
  return (
    <div style={{ backgroundImage: `url("https://images.unsplash.com/photo-1466637574441-749b8f19452f?ixlib=rb-1.2.1&ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&auto=format&fit=crop&w=2428&q=80")`, marginTop: "175px" }}>
      {isSignIn ? <SignIn /> : <SignUp />}
    </div>
  );
};

export default Authenticate;
